  const navigate = useNavigate();


  localStorage.removeItem("token");
  const refreshPage = ()=>{
    window.location.reload()
  }
  useEffect(() => {
    
    navigate("/");
    
  }, [navigate, refreshPage]);
  //refreshPage();
  return <div></div>;
}

export default Logout;
